    if len(colors)!= len(patterns):
        return False

    sdict = {}
    pset = set()
    sset = set()

    for i in range(len(patterns)):
        pset.add(patterns[i])
        sset.add(colors[i])
        if patterns[i] not in sdict.keys():
            sdict[patterns[i]] = []
            sdict[patterns[i]].append(colors[i])
        else:
            sdict[patterns[i]].append(colors[i])

    # Check if all patterns are present in the colors list
