def find_triplet_with_sum(arr: List[int], n: int, sum: int) -> bool:
    arr.sort()
    for i in range(n - 2):
        left, right = i + 1, n - 1
        while left < right:
            current_sum = arr[i] + arr[left] + arr[right]
            if current_sum == sum:
                return True
            elif current_sum < sum:
                left += 1
            else:
                right -= 1
    return False

