def is_valid_parentheses(str1: str) -> bool:
    stack = []
    pchar = {"(": ")", "{": "}", "[": "]"}

    for parenthese in str1:
        if parenthese in pchar:
            stack.append(parenthese)
        elif parenthese in pchar.values():
            if not stack or stack.pop()!= pchar[parenthese]:
                return False

